import React,{Component} from 'react';
import {
  Container,
  Nav,
  Navbar
}from "react-bootstrap";
class App extends Component {
  render() {
    return(
      <Container>
        <Navbar bg="dark" variant="dark">
          <Navbar.Brand style={{colo:"white"}} href="/">Menu</Navbar.Brand>
          <Nav>

          </Nav>
        </Navbar>
      </Container>
    );
  }
}


export default App;
